import React from "react";
import { IoMail, IoCall } from "react-icons/io5";
import emailjs, { init } from 'emailjs-com';


function contact(){

    function sendEmail(e) {
        e.preventDefault();

        emailjs.sendForm('zoho', 'template_2nika1e', e.target, 'user_m4yKPukA2PawmJR2074c6')
          .then((result) => {
              console.log(result.text);
          }, (error) => {
              console.log(error.text);
          });
          e.target.reset();
      }

    return(
        <div id="contact-container">
            <h1 class="title">Contact Us</h1>
            <div class="container">
                <div class="information">
                    <div class="number">
                        <div class="image">
                            <IoCall size="6rem" color="white" />
                        </div>
                        <div class="info">
                            <h1>Phone Number</h1>
                            <h2>647-835-4402</h2>
                        </div>
                    </div>
                    <div class="email">
                        <div class="image">
                            <IoMail size="6rem" color="white" />
                        </div>
                        <div class="info">
                            <h1>Email</h1>
                            <h2>contact@hawkbuilders.ca</h2>
                        </div> 
                    </div>
                </div>
                <div class="divider"></div>
                <div class="contact">
                    <form onSubmit={onClick}>
                        <div>
                            <input type="text" name="name" placeholder="Your Name" required/>
                        </div>
                        <div>
                            <input type="text" name="number" placeholder="Your Phone Number" required/>
                        </div>

                        <div>
                            <input type="text" name="email" placeholder="Your Email Adress" required/>
                        </div>

                        <div>
                            <textarea name="message" placeholder="Type your message here"></textarea>
                        </div>
                        <div class="btn-container">
                            <input class="btn" type="submit" value="SUBMIT"></input>
                        </div>
                    </form>
                </div>
            </div>
        </div>
    );
}

export default contact;
